import { StyledSearchBar } from './searchbar.styles'

export default function SearchBar() {
  return (
    <StyledSearchBar>
      Container
      <Input 
        type={'text'} 
        placeholder={'Busque um cliente pelo nome ou id...'} 
        id={'search-bar'} 
        width='1200px'    
      />
    </StyledSearchBar>
  )
}
